import React from 'react';

const Player = props => {
  return (
    <div className="col-4">
      <div className={'tile-alt status-' + props.status}>
        <div>
          <h5>Alfredo</h5>
        </div>
        <div class="tile-icon">
          <i class="far fa-smile"></i>
        </div>
      </div>
    </div>
  );
};
export default Player;
